import React from 'react'
import Cell from './Cell'
import Input from './Input'

export default () => {

    const creategrid = () => {
        const cells = []
        for(let i=0; i<=1575; i++) {
            cells.push(<Cell key={i}></Cell>)
        }
        return cells
    }

    return (
        <div className='grid'>
            {creategrid()}
        </div>
    )

}


